PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE tipos_producto (
        id INTEGER PRIMARY KEY AUTOINCREMENT,
        nombre TEXT UNIQUE NOT NULL, stock_minimo INTEGER DEFAULT 0);
CREATE TABLE articulos (
        id INTEGER PRIMARY KEY AUTOINCREMENT,
        tipo_id INTEGER,
        marca TEXT,
        modelo TEXT,
        imei TEXT UNIQUE,
        estado TEXT,
        sucursal TEXT,
        fecha_registro TIMESTAMP DEFAULT CURRENT_TIMESTAMP
    , memoria TEXT, color TEXT, proveedor TEXT, precio REAL, factura_id TEXT, fecha_compra DATE, imei2 TEXT, estatus TEXT DEFAULT 'Nuevo', imei1 TEXT);
/****** CORRUPTION ERROR *******/
CREATE TABLE log_actividad (
        id INTEGER PRIMARY KEY AUTOINCREMENT,
        usuario TEXT,
        tipo TEXT,
        descripcion TEXT,
        fecha TIMESTAMP DEFAULT CURRENT_TIMESTAMP
    , accion TEXT, origen TEXT DEFAULT 'Inventario');
CREATE TABLE transferencias (
        id INTEGER PRIMARY KEY AUTOINCREMENT,
        articulo_id INTEGER,
        sucursal_origen TEXT,
        sucursal_destino TEXT,
        fecha TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
        usuario TEXT
    , estatus TEXT DEFAULT 'pendiente-envío', imei TEXT, id_lote TEXT);
/****** CORRUPTION ERROR *******/
CREATE TABLE usuarios (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  nombre TEXT NOT NULL UNIQUE,
  tipo TEXT CHECK(tipo IN ('admin', 'consulta', 'reparto')) NOT NULL,
  contraseña TEXT NOT NULL
, correo TEXT, telefono TEXT, aprobado INTEGER DEFAULT 0, recibe_todos_pendientes INTEGER DEFAULT 0);
CREATE TABLE IF NOT EXISTS "caja" (denom INTEGER PRIMARY KEY, cantidad INTEGER);
CREATE TABLE ciclos (id INTEGER PRIMARY KEY, sucursal TEXT, fecha TEXT, datos TEXT);
CREATE TABLE objetivos (sucursal TEXT, denom INTEGER, objetivo INTEGER, PRIMARY KEY(sucursal, denom));
CREATE TABLE anticipos (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                folio TEXT,
                monto REAL,
                fecha TEXT,
                sucursal TEXT
            );
CREATE TABLE dolares (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                tipo TEXT,
                cantidad INTEGER,
                monto REAL,
                fecha TEXT,
                sucursal TEXT
            , tipo_cambio TEXT);
CREATE TABLE fondo_caja (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                monto REAL,
                fecha TEXT,
                sucursal TEXT
            , cantidad REAL DEFAULT 0);
CREATE TABLE gastos (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                folio TEXT,
                motivo TEXT,
                monto REAL,
                fecha TEXT,
                sucursal TEXT
            );
CREATE TABLE notas (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                texto TEXT,
                fecha TEXT,
                sucursal TEXT
            );
CREATE TABLE IF NOT EXISTS "ventas" (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    descripcion TEXT,
    concepto TEXT,
    tipo TEXT,
    referencia TEXT,
    precio REAL,
    pagado REAL,
    cambio REAL,
    dolar REAL,
    fecha TEXT,
    sucursal TEXT
, metodo_pago TEXT, usuario TEXT, tipo_pago TEXT, eliminado INTEGER DEFAULT 0, imei TEXT, pag_efectivo REAL DEFAULT 0, pag_tarjeta  REAL DEFAULT 0, pag_dolares  REAL DEFAULT 0, tipo_cambio  REAL DEFAULT 0);
CREATE TABLE garantias_recibidas (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    cliente TEXT,
    recibido_por TEXT,
    imei TEXT,
    modelo TEXT,
    fecha_venta TEXT,
    condiciones TEXT,
    accesorios TEXT,
    faltante TEXT,
    daños TEXT,
    problema TEXT,
    tipo_recepcion TEXT,
    pagos TEXT,
    fotos TEXT,
    captura_grupo TEXT,
    fecha_registro TEXT
);
CREATE TABLE cantidad_actual_temp (
    sucursal TEXT,
    fecha TEXT,
    datos TEXT
);
CREATE TABLE IF NOT EXISTS "mensajes_chat" (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    fecha TEXT NOT NULL,
    remitente TEXT NOT NULL,
    destinatario TEXT NOT NULL,
    mensaje TEXT NOT NULL,
    modulo TEXT,
    leido INTEGER DEFAULT 0,
    archivo TEXT
, tipo_destinatario TEXT, grupo TEXT DEFAULT NULL);
CREATE TABLE grupos_chat (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    nombre TEXT NOT NULL,
    miembros TEXT NOT NULL,
    creado_por TEXT,
    fecha TEXT
);
CREATE TABLE fondo (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  sucursal TEXT,
  denominacion INTEGER,
  cantidad_objetivo INTEGER DEFAULT 0,
  cantidad_actual INTEGER DEFAULT 0,
  cantidad_repuesta INTEGER DEFAULT 0
);
CREATE TABLE inventarios_pendientes (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    sucursal TEXT,
    fecha TEXT,
    generado_por TEXT,
    imei TEXT
, confirmado TEXT);
CREATE TABLE inventario_respuesta (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    sucursal TEXT,
    fecha TEXT,
    imei TEXT,
    tipo TEXT,
    memoria TEXT,
    color TEXT,
    estado_actual TEXT,
    encontrado TEXT, -- 'Sí', 'No'
    observacion TEXT,
    confirmado_por TEXT
);
CREATE TABLE bloqueos_feria (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    sucursal TEXT NOT NULL,
    fecha TEXT NOT NULL,
    motivo TEXT NOT NULL,
    autorizado INTEGER DEFAULT 0
);
CREATE TABLE codigos_verificacion(
                    usuario TEXT,
                    codigo TEXT,
                    contacto TEXT,
                    expira INTEGER
                );
CREATE TABLE pendientes (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  tipo TEXT NOT NULL,
  referencia TEXT,
  sucursal TEXT,
  fecha TEXT,
  detalle TEXT,
  estado TEXT DEFAULT 'pendiente',
  creado_por TEXT,
  autorizado_por TEXT,
  fecha_autorizacion TEXT
);
CREATE TABLE pendientes_involucrados (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  pendiente_id INTEGER NOT NULL,
  usuario TEXT NOT NULL,
  estado TEXT DEFAULT 'pendiente',
  ultimo_correo TEXT,
  recordatorios INTEGER DEFAULT 0
);
CREATE TABLE stickers_usuarios(
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            usuario TEXT,
            archivo TEXT
        );
CREATE TABLE stickers_favoritos(
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            usuario TEXT,
            sticker TEXT
        );
DELETE FROM sqlite_sequence;
ROLLBACK; -- due to errors
